import React from 'react';
import './App.css';
import NavBar from './components/NavBar'
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Switch>
        <Router> 

          <NavBar/>
        </Router>
        </Switch>
    </div>
  );
}

export default App;
